records.addlTxt:
Defendant in custody on WRIT.   
State moves to delete the penalty enhancer from Count 1.  Motion granted.   Count 1 -Deliver Methamphetamine - No contest plea.   Convicted.  State moves to dismiss and read in count 2, deliver cocaine, 2nd and subsequent offense.   Motion granted.   Defendant is sentenced to the Wisconsin State Prison System for a total sentence of three (3) years.   Twelve (12) months initial confinement, followed by twenty-four (24) months extended supervision, consecutive to the sentence defendant is serving on Brown County Case 15 CF 229.   Conditions of extended supervision are:
1) Maintain absolute sobriety; 
2) AODA assessment and follow through;
3) Submit to random urine screens and pay for same;
4) Obtain GED/HSED;
5) Pay costs of action;
6) Pay supervision fees in an amount to be determined by DOC;
7) Have no contact with any known drug users of dealers;
8) Submit DNA sample.  
Court finds the defendant is eligible for the Challenge Incarceration Program and the Substance Abuse Program.   
Minutes.
